import React from 'react';

const Books = ({ students }) => {
  return (
    <div>
      <h3>Books</h3>
      {students.map((student, index) => (
        <div key={index}>
          <h4>{student.name}</h4>
          <ul>
            {student.selectedBooks.map((book, bookIndex) => (
              <li key={bookIndex}>{book}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default Books;
